μ-(CH3)2Si(tetramethylcyclopentadienyl)(1-tertbutylamido)M(R)2;
μ-(CH3)2Si(fluorenyl)(1-tertbutylamido)M(R)2;
μ-(CH3)2Si(tetramethylcyclopentadienyl)(1-cyclododecylamido)M(R)2;
μ-(C6H5)2C(tetramethylcyclopentadienyl)(1-cyclododecylamido)M(R)2; and
μ-(CH3)2Si(η5-2,6,6-trimethyl-1,5,6,7-tetrahydro-s-indacen-1-yl)(tertbutylamido)M(R)2;
where M is selected from Ti, Zr, and Hf; and R is selected from halogen or C1 to C5 alkyl.

In preferred aspects, the transition metal complex may comprise one or more of: dimethylsilyl (tetramethylcyclopentadienyl)(cyclododecylamido)titanium dimethyl; dimethylsilyl (tetramethylcyclopentadienyl)(cyclododecylamido)titanium dimethyl; dimethylsilyl (tetramethylcyclopentadienyl)(t-butylamido)titanium dimethyl; dimethylsilyl (tetramethylcyclopentadienyl)(t-butylamido)titanium dimethyl;
μ-(CH3)2Si(cyclopentadienyl)(1-adamantylamido)titanium dimethyl;
μ-(CH3)2Si(3-tertbutylcyclopentadienyl)(1-adamantylamido)titanium dimethyl;
μ-(CH3)2(tetramethylcyclopentadienyl)(1-adamantylamido)titanium dimethyl;
μ-(CH3)2Si(tetramethylcyclopentadienyl)(1-adamantylamido)titanium dimethyl;
μ-(CH3)2C(tetramethylcyclopentadienyl)(1-adamantylamido)titanium dimethyl;
μ-(CH3)2Si(tetramethylcyclopentadienyl)(1-tertbutylamido)titanium dimethyl2;
μ-(CH3)2Si(fluorenyl)(1-tertbutylamido)titanium dimethyl;
μ-(CH3)2Si(tetramethylcyclopentadienyl)(1-cyclododecylamido)titanium dimethyl;
μ-(C6H5)2C(tetramethylcyclopentadienyl)(1-cyclododecylamido)titanium dimethyl; and/or
μ-(CH3)2Si(η5-2,6,6-trimethyl-1,5,6,7-tetrahydro-s-indacen-1-yl)(tertbutylamido)titanium dimethyl.
